VALUES ('3276550314950', 'Donut', 'Farine de _blé_; Milka - Chocolat au lait du pays Alpin (19%) (Sucre, beurre de cacao, poudre de _lait_ écrémé, pâte de cacao, poudre de _lactosérum_, _beurre_ clarifié, pâte de _noisette_, émulsifiant : lécithine de _soja_, arôme); matière grasse végétale (palme, coco), eau; sucre; farine de _seigle_; huile végétale (colza); émulsifiants : mono- et diglycérides d\'acides gras; lécithines, lécithine de _soja_, dextrose; sel; sirop de glucose; poudre d\'_oeuf_ entier; poudre de _lait_ écrémé; arôme; farine de _soja_; épaississant : gomme xanthane; amidon modifié; extrait de colorant végétale (carotte); maltodextrine.', 'https://static.openfoodfacts.org/images/products/327/655/031/4950/front_fr.12.400.jpg', '28', '13.7', '46.2', '17.5', '2.3', '7', '0.8', '0.31496062992126', '', '0');

